const edit = resolve => {
  import('./edit').then(module => {
    resolve(module)
  })
}
const index = resolve => {
  import('./index').then(module => {
    resolve(module)
  })
}
const create = resolve => {
  import('./create').then(module => {
    resolve(module)
  })
}
const preview = resolve => {
  import('./preview').then(module => {
    resolve(module)
  })
}
const detail = resolve => {
  import('./detail').then(module => {
    resolve(module)
  })
}

export default [
  {
    path: '/marketing',
    redirect: '/marketing/index'
  },
  {
    name: 'marketingEdit',
    path: '/marketing/edit',
    component: edit,
    meta: {
      nav: false,
      auth: true,
      keepAlive: true,
      title: '编辑营销网页'
    }
  },
  {
    name: 'marketingEdit',
    path: '/marketing/edit/:id',
    component: edit,
    meta: {
      nav: false,
      auth: true,
      keepAlive: true,
      title: '编辑营销网页'
    }
  },
  {
    name: 'marketingIndex',
    path: '/marketing/index',
    component: index,
    meta: {
      nav: false,
      auth: true,
      title: '营销网页',
      keepAlive: true
    }
  },
  {
    name: 'marketingCreate',
    path: '/marketing/create',
    component: create,
    meta: {
      nav: false,
      auth: true,
      keepAlive: true,
      title: '创建营销网页'
    }
  },
  {
    name: 'marketingPreview',
    path: '/marketing/preview',
    component: preview,
    meta: {
      nav: false,
      auth: true,
      title: '预览营销网页'
    }
  },
  {
    name: 'marketingDetail',
    path: '/marketing/detail/:id',
    component: detail,
    meta: {
      nav: false,
      title: '营销网页详情'
    }
  }
]
